import React from "react";
export default function Sidebar(){
  return (
    <aside className="sidebar">
      <h2>BuyBlink Admin</h2>
      <ul>
        <li>Dashboard</li>
        <li>Add Product</li>
        <li>Products List</li>
      </ul>
    </aside>
  );
}
